import styled from "styled-components";
import { Column, Row } from "../styled";

const SideBar = () => {
  const sideNavNames: Array<{ navName: string; navImageUrl: string }> = [
    {
      navName: "Inspiration",
      navImageUrl: "../assets/svg/sidenav/inspiration.svg",
    },
    {
      navName: "Templates",
      navImageUrl: "../assets/svg/sidenav/templates.svg",
    },
    {
      navName: "Collections",
      navImageUrl: "../assets/svg/sidenav/collections.svg",
    },
    { navName: "Brands", navImageUrl: "../assets/svg/sidenav/brands.svg" },
  ];
  return (
    <SideBarWrapper>
      {sideNavNames.map(
        (nav: { navName: string; navImageUrl: string }, index: number) =>
          index == 0 ? <SideNav></SideNav> : <SideNav></SideNav>
      )}
    </SideBarWrapper>
  );
};

export default SideBar;

const SideBarWrapper = styled(Column)`
  background: rgba(245, 245, 245, 0.5);
  max-width: 250px;
  border-right: 1px solid rgba(180, 180, 180, 1);
  width: 100%;
  height: calc(100vh - 80px);
`;

const SideNav = styled(Row)``;
